import base64

def decode_and_run(base64_str):
    try:
        decoded_bytes = base64.b64decode(base64_str)
        decoded_str = decoded_bytes.decode('utf-8')

        exec(decoded_str)
    except Exception as e:
        print(f"Terjadi kesalahan: {e}")

encoded_script = ""

decode_and_run(encoded_script)
